import React from 'react'
import logo from '../images/logo.jpg'
export default function Navbar() {


  function handleScroll() {
    const styles = { 
      position:"fixed",
      backgroundColor:'black'
    }
  }

  return (

    <nav className='navbar' onScroll={handleScroll} style = {styles}>
        <a className='logo'><img src = {logo}/><p className='title'>ILLUMZ</p></a>
        <ul className='start'>
          <li><a className='home--page selected' >Home</a></li>
          <li><a className='usage--page'>Usage</a></li>
          <li><a className='shop--page'>Shop</a></li>   
        </ul>
        <ul className='end'>         
          <li><a className='login'>Sign in</a></li>
          <hr></hr>
          <li><a className='sign-in'>Create account</a></li>
        </ul>
    </nav>
  )
}
